import React from "react";
import './Footer.css';

const Footer = () => {
    return (
        <div className="footer">
            <div className="social-media">
                <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">
                    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Instagram_logo_2022.svg/1000px-Instagram_logo_2022.svg.png" alt="Instagram" className="social-icon" />
                </a>
                <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">
                    <img src="/path-to-facebook-icon.png" alt="Facebook" className="social-icon" />
                </a>
                <a href="https://www.twitter.com" target="_blank" rel="noopener noreferrer">
                    <img src="/path-to-twitter-icon.png" alt="Twitter" className="social-icon" />
                </a>
            </div>
            <div>Â© 2024 Diederich Solis</div>
        </div>
    );
}

export default Footer;
